import React from 'react'
import { withStyles, makeStyles } from '@material-ui/core/styles'
import PropTypes from 'prop-types'
import {Box,Typography,Card, CardActionArea, CardActions, CardContent, CardMedia} from '@material-ui/core'
import Text from '../text'

const styles = (theme) => ({
    root : {
        padding : 20,
        boxShadow: '0 0 6px 0 rgba(0, 0, 0, 0.1)',
        borderRadius : 10
    },
    upper : {
        display : "flex",
        flexDirection : "column"
    },
    titleWrap : {
        display : "flex",
        flexDirection : "row",
        justifyContent : "space-between"
    },
    text : {
        lineHeight : 1
    }
})

const useStyles = makeStyles({
    root: {
      maxWidth: 345,
    },
    media: {
      height: 140,
    },
  });

const OrderCard = ({ classes }) => {
    const useClasses = useStyles();

    return <Box>
        <Box className={classes.root}>
            <Box className={classes.upper}>
                <Box className={classes.titleWrap}>
                    <Box><Text variant="body2" ffamily="Poppins" className={classes.text}>Mechanic</Text></Box>
                </Box>
                <Box>
                    <Text variant="caption" ffamily="Poppins" className={classes.text}>
                        180 B Hazrat Nizamuddin Colony
                    </Text>
                </Box>
                <Box>
                    <Text variant="caption" ffamily="Poppins" className={classes.text}>
                        View Deatils
                    </Text>
                </Box>
                <Box>

                </Box>
            </Box>
            <Box>
                <Box></Box>
            </Box>
        </Box>
    </Box>
}

OrderCard.propTypes = {
    // eslint-disable-next-line react/forb,id-prop-types
    classes: PropTypes.object.isRequired,
}

export default withStyles(styles)(OrderCard)
